import React from 'react';
import { Route, Navigate } from "react-router-dom";

const ProtectedRoute = ({ isAuth, children, ...props }) => {
    return (
        <Route {...props}>
            {isAuth ? children : <Navigate to="/login" />}
        </Route>
    )
}

export default ProtectedRoute;
